import java.io.*;
import java.util.*;

public class Main {
    static class FastReader {
        BufferedReader br;
        StringTokenizer st;

        public FastReader() {
            br = new BufferedReader(new InputStreamReader(System.in));
        }

        String next() {
            while (st == null || !st.hasMoreElements()) {
                try {
                    st = new StringTokenizer(br.readLine());
                } catch (IOException e) {
                    e.printStackTrace();
                }
            }
            return st.nextToken();
        }

        int nextInt() {
            return Integer.parseInt(next());
        }

        long nextLong() {
            return Long.parseLong(next());
        }

        double nextDouble() {
            return Double.parseDouble(next());
        }

        String nextLine() {
            String str = "";
            try {
                str = br.readLine();
            } catch (IOException e) {
                e.printStackTrace();
            }
            return str;
        }
    }

    static class Pair implements Comparable<Pair> {
        long first;
        long second;

        public Pair(long first, long second) {
            this.first = first;
            this.second = second;
        }

        public int compareTo(Pair other) {
            if (this.first != other.first) {
                return Long.compare(this.first, other.first);
            } else {
                return Long.compare(this.second, other.second);
            }
        }
    }

    public static void main(String[] args) {
        FastReader sc = new FastReader();
        PrintWriter out = new PrintWriter(System.out);
        int n = sc.nextInt();
        int m = sc.nextInt();
        int k = sc.nextInt();
        long a = sc.nextLong();
        long b = sc.nextLong();
        long c = sc.nextLong();
        long t = sc.nextLong();
        long[] s = new long[m + 1];
        for (int i = 1; i <= m; i++) {
            s[i] = sc.nextLong();
        }
        long[] dp = new long[n + 1];
        Arrays.fill(dp, Long.MIN_VALUE);
        dp[1] = 0;
        for (int i = 1; i <= m; i++) {
            for (int j = 1; j <= n; j++) {
                if (dp[j] < 0) continue;
                long time = dp[j] * c + (s[i] - j) * b;
                if (time <= t) {
                    dp[(int) s[i]] = Math.max(dp[(int) s[i]], dp[j] + 1);
                }
            }
        }
        long ans = 0;
        for (int i = 1; i <= n; i++) {
            if (dp[i] >= 0) {
                ans = Math.max(ans, i);
            }
        }
        out.println(ans - 1);
        out.close();
    }
}
